  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import React,{ Component } from 'react';
import Footer from './footer/Footer';
import RouterURL from './router/RouterURL';
import Nav from "./nav/Nav";
class App extends Component {
  render(){
  return (
    <div className="App">
      
        <Nav />
        <RouterURL />
        <Footer />
      
    </div>
  );
}
}

export default App;
